    correct_pid = None
    correct_name = "NoName"
    final_data = {"tags": "['-']",
                  "editorial_link": None,
                  "user_ids": "",
                  "custom_user_ids": ""}
    for pid in pids:
        record = precord_mapping[pid]
        # print record.name, record.user_ids, record.custom_user_ids, record.editorial_link, record.tags, record.solved_submissions, record.total_submissions
        pnames.add(record.name)
